var reset_btn = document.getElementById("reset");
var verify_btn = document.getElementById("btn");
var human = document.querySelectorAll("p")[0];
var robot = document.querySelectorAll("p")[1];
var image = [];
var shuffledArray=[];
var firstclick, secondclick, count = 0;
reset_btn.style.display = "none";
verify_btn.style.display = "none";
human.style.display = "none";
human.style.color = "green";
robot.style.display = "none";
robot.style.color = "red";
function createImage () {

        var imgEle =  document.createElement("img");
        imgEle.setAttribute("data-ns-test", `img1`);
        imgEle.setAttribute("src", "data:image/jpeg;base64,");
        image.push(imgEle);
        imgEle.onclick = function() {clicked(this)};
        
        imgEle =  document.createElement("img");
        imgEle.setAttribute("data-ns-test", `img2`);
        imgEle.setAttribute("src", "data:image/jpeg;base64,");
        image.push(imgEle);
        imgEle.onclick = function() {clicked(this)};
        
        imgEle =  document.createElement("img");
        imgEle.setAttribute("data-ns-test", `img3`);
        imgEle.setAttribute("src", "data:image/jpeg;base64,");
        image.push(imgEle);
        imgEle.onclick = function() {clicked(this)};
        
        imgEle =  document.createElement("img");
        imgEle.setAttribute("data-ns-test", `img4`);
        imgEle.setAttribute("src", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRQdpPD3wGKBReSCaFApGYZb85s2PgievUFhQ&usqp=CAU");
        image.push(imgEle);
        imgEle.onclick = function() {clicked(this)};
       
        imgEle =  document.createElement("img");
        imgEle.setAttribute("data-ns-test", `img5`);
        imgEle.setAttribute("src", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSbmCjKKEuI8k2h2mT1DIva42y6cVPUeRtZQg&usqp=CAU");
        image.push(imgEle);
        imgEle.onclick = function() {clicked(this)};
}
createImage();

function insertImage () {
    var random = Math.floor(Math.random()*5) + 1;
    var newIdentical = document.createElement("img");
    newIdentical.setAttribute("data-ns-test", `img${random-1}`);
    newIdentical.setAttribute("src", image[random-1].getAttribute("src"));
    newIdentical.onclick = function() {clicked(this)};
    image.push(newIdentical);
    
    shuffledArray = image.sort(() => Math.random() - 0.5);

    var ele = document.getElementById("container");
    for(var i=0; i<6; i++){
        ele.appendChild(shuffledArray[i]);
    }
}
insertImage();

function clicked (image) {
    if(count === 0){
        firstclick = image;
        count++;
        reset_btn.style.display = "block";
    }else{
        if(firstclick !== image && count<2){
            count++;
            secondclick = image;
            verify_btn.style.display = "block";
        }
    }
}

reset_btn.addEventListener("click",reset);

function reset () {

    console.log("clickedReset");
    var ele = document.getElementById("container");
    
    while (ele.hasChildNodes()) {               //delete every pictures from dom
        ele.removeChild(ele.firstChild);
    }
    image.splice(0);                            //delete every image from array
    createImage();
    insertImage();
    reset_btn.style.display = "none";
    count = 0;
    human.style.display = "none";
    robot.style.display = "none";
    verify_btn.style.display = "none";
}

verify_btn.addEventListener("click",verify);

function verify () {
    console.log("clickedVerify");
    if(firstclick.getAttribute("src") == secondclick.getAttribute("src")){
        human.style.display = "block";
    }else{
        robot.style.display = "block";
    }
    verify_btn.style.display = "none";
}